import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import StarRating from '../components/StarRating';

export default function Products(){
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(()=>{
    setLoading(true);
    fetch('https://fakestoreapi.com/products')
      .then(res => {
        if(!res.ok) throw new Error('Network response not ok');
        return res.json();
      })
      .then(data => setItems(data))
      .catch(err => setError(err.message))
      .finally(()=> setLoading(false));
  },[]);

  if(loading) return <div className="container">Loading products...</div>;
  if(error) return <div className="container">Error: {error}</div>;

  return (
    <div>
      <div style={{marginBottom:12}}>Showing {items.length} products</div>
      <div className="grid">
        {items.map(item => (
          <div className="card" key={item.id}>
            <img src={item.image} alt={item.title} />
            <Link to={`/product/${item.id}`} className="title">{item.title}</Link>
            <div className="price">${item.price}</div>
            <StarRating value={item.rating?.rate ?? 0} />
          </div>
        ))}
      </div>
    </div>
  );
}
